import partnerCol1 from "../../../Assets/svg/partnerCol1.svg";
import partnerCol2 from "../../../Assets/svg/partnerCol2.svg";
import partnerCol3 from "../../../Assets/svg/partnerCol3.svg";
import partnerCol4 from "../../../Assets/svg/partnerCol4.svg";
import partnerCol5 from "../../../Assets/svg/partnerCol5.svg";
import partnerCol6 from "../../../Assets/svg/partnerCol6.svg";

export const list1 = [
  {
    img: partnerCol1,
    title: "In-the-know support",
    paragraf:
      "Our support in growing payment solutions is designed to unlock innovation.",
    bgColor: "none",
    pBold: "bold",
    color: "#707070",
  },
  {
    img: partnerCol2,
    title: "Feel the flow",
    paragraf: "Our tech is designed to get more out of what you already have.",
    bgColor: "none",
    pBold: "bold",
    color: "#707070",
  },
  {
    img: partnerCol3,
    title: "Next-level clarity",
    paragraf:
      "With us, merchants see more innovation and control over their payments.",
    bgColor: "none",
    pBold: "bold",
    color: "#707070",
  },
];
export const list2 = [
  {
    img: partnerCol4,
    title: "Unlock growth",
    paragraf:
      "Our technology gives you lightning-fast, dependable, clear payment processing.",
    bgColor: "none",
    pBold: "bold",
    color: "#707070",
  },
  {
    img: partnerCol5,
    title: "Go where you need to",
    paragraf:
      "Accept all major credit and debit cards, local payments, domestic cards, digital wallets.",
    bgColor: "none",
    pBold: "bold",
    color: "#707070",
  },
  {
    img: partnerCol6,
    title: "Deep insights",
    paragraf:
      "Our end-to-end platform. It’s the payments tech that unleashes your potential.",
    bgColor: "none",
    pBold: "bold",
    color: "#707070",
  },
];
